One.onLoad(class {
    static initValidation() {
        One.helpers("jq-validation"), jQuery(".kullanici-sil").validate({
            rules: {
                "kullanici_id": {
                    required: !0,
                    minlength: 1
                }
            },
            messages: {
                "kullanici_id": {
                    required: "Silmek istediğin Kullanıcı IDsini belirt.",
                    minlength: "Kullanıcı ID en az 1 karakter olmak zorundadır."
                }
            }
        })
    }
    static init() {
        this.initValidation()
    }
}.init());